// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

contract VoteSystem {
    // 1. 
    address public immutable admin;

    // unicode
    error ProposalError(string reason);
    error WhitelistError(string reason);
    error VoteError(string reason);
    error RegisterError(string reason);

    // 2. 
    mapping(address => bool) public voterWhitelist;

    // 3. 
    struct VotingProposal {
        string title;          // 
        string[] options;      // 2
        uint startTime;        // Unix
        uint endTime;          // Unix
        bool isActive;         // 
    }

    // 4. ID
    mapping(uint => VotingProposal) public proposals;
    uint public proposalCount;

    // 5. ID+
    mapping(uint => mapping(address => bool)) public hasVoted;

    // 6. ID+ID
    mapping(uint => mapping(uint => uint)) public optionVoteCounts;

    // 7. 
    enum ApplyStatus {
        Pending,    // 
        Approved,   // 
        Rejected    // 
    }

    // 8. 
    struct RegisterApply {
        address applicantAddress;  // 
        uint applyTime;           // 
        ApplyStatus status;        // 
        uint auditTime;            // 0
    }

    // 9. ID
    mapping(uint => RegisterApply) public registerApplies;
    uint public registerApplyCount;

    // 10. ID
    mapping(address => uint) public addressToApplyId;

    // 11. 
    event RegisterApplySubmitted(uint indexed applyId, address indexed applicant, uint applyTime);
    event RegisterApplyAudited(uint indexed applyId, address indexed applicant, ApplyStatus status, uint auditTime);

    // 
    modifier onlyAdmin() {
        if (msg.sender != admin) {
            // unicode
            revert ProposalError(unicode"");
        }
        _;
    }

    // 
    constructor() {
        admin = msg.sender;
    }

    // 1
    function addVoterToWhitelist(address _voter) external onlyAdmin {
        if (_voter == address(0)) {
            // unicode
            revert WhitelistError(unicode"");
        }
        voterWhitelist[_voter] = true;
    }

    // 2
    function createVotingProposal(
        string calldata _title,
        string[] calldata _options,
        uint _startTime,
        uint _endTime
    ) external onlyAdmin {
        // 2
        if (_options.length < 2) {
            revert ProposalError(unicode"2");
        }
        // 
        if (_startTime >= _endTime) {
            revert ProposalError(unicode"");
        }
        // 
        if (_startTime < block.timestamp) {
            revert ProposalError(unicode"");
        }
        // 
        if (bytes(_title).length == 0) {
            revert ProposalError(unicode"");
        }

        // 
        proposals[proposalCount] = VotingProposal({
            title: _title,
            options: _options,
            startTime: _startTime,
            endTime: _endTime,
            isActive: true
        });

        // +1
        proposalCount++;
    }

    // 3
    function castVote(uint _proposalId, uint _optionId) external {
        // 1
        if (_proposalId >= proposalCount) {
            revert VoteError(unicode"ID");
        }
        VotingProposal storage proposal = proposals[_proposalId];
        if (!proposal.isActive) {
            revert VoteError(unicode"");
        }

        // 2
        if (!voterWhitelist[msg.sender]) {
            revert VoteError(unicode"");
        }

        // 3
        if (block.timestamp < proposal.startTime || block.timestamp > proposal.endTime) {
            revert VoteError(unicode"");
        }

        // 4ID
        if (_optionId >= proposal.options.length) {
            revert VoteError(unicode"ID");
        }

        // 5
        if (hasVoted[_proposalId][msg.sender]) {
            revert VoteError(unicode"");
        }

        // 
        hasVoted[_proposalId][msg.sender] = true;
        optionVoteCounts[_proposalId][_optionId]++;
    }

    // 4
    function getProposalOptions(uint _proposalId) external view returns (string[] memory) {
        if (_proposalId >= proposalCount) {
            revert VoteError(unicode"ID");
        }
        return proposals[_proposalId].options;
    }

    // 5
    function getOptionVoteCount(uint _proposalId, uint _optionId) external view returns (uint) {
        if (_proposalId >= proposalCount) {
            revert VoteError(unicode"ID");
        }
        if (_optionId >= proposals[_proposalId].options.length) {
            revert VoteError(unicode"ID");
        }
        return optionVoteCounts[_proposalId][_optionId];
    }

    // 6
    function getProposalWinner(uint _proposalId) external view returns (string memory, uint) {
        if (_proposalId >= proposalCount) {
            revert VoteError(unicode"ID");
        }
        VotingProposal storage proposal = proposals[_proposalId];
        if (block.timestamp <= proposal.endTime) {
            revert VoteError(unicode"");
        }

        uint maxVotes = 0;
        uint winnerOptionId = 0;

        // 
        for (uint i = 0; i < proposal.options.length; i++) {
            uint voteCount = optionVoteCounts[_proposalId][i];
            if (voteCount > maxVotes) {
                maxVotes = voteCount;
                winnerOptionId = i;
            }
        }

        return (proposal.options[winnerOptionId], maxVotes);
    }

    // 7
    function submitRegisterApply() external {
        address applicant = msg.sender;
        
        // 1
        if (applicant == address(0)) {
            revert RegisterError(unicode"");
        }
        
        // 2
        if (voterWhitelist[applicant]) {
            revert RegisterError(unicode"");
        }
        
        // 3
        uint existingApplyId = addressToApplyId[applicant];
        if (existingApplyId > 0) {
            RegisterApply storage existingRegisterApply = registerApplies[existingApplyId - 1];
            if (existingRegisterApply.status == ApplyStatus.Pending) {
                revert RegisterError(unicode"");
            }
        }
        
        // 
        registerApplies[registerApplyCount] = RegisterApply({
            applicantAddress: applicant,
            applyTime: block.timestamp,
            status: ApplyStatus.Pending,
            auditTime: 0
        });
        
        // IDID0+1
        addressToApplyId[applicant] = registerApplyCount + 1;
        
        // 
        emit RegisterApplySubmitted(registerApplyCount, applicant, block.timestamp);
        
        // +1
        registerApplyCount++;
    }

    // 8
    function auditRegisterApply(uint _applyId, bool _approve) external onlyAdmin {
        // 1ID
        if (_applyId >= registerApplyCount) {
            revert RegisterError(unicode"ID");
        }
        
        RegisterApply storage registerApply = registerApplies[_applyId];
        
        // 2
        if (registerApply.status != ApplyStatus.Pending) {
            revert RegisterError(unicode"");
        }
        
        // 
        if (_approve) {
            registerApply.status = ApplyStatus.Approved;
            // 
            voterWhitelist[registerApply.applicantAddress] = true;
        } else {
            registerApply.status = ApplyStatus.Rejected;
        }
        
        registerApply.auditTime = block.timestamp;
        
        // 
        emit RegisterApplyAudited(_applyId, registerApply.applicantAddress, registerApply.status, block.timestamp);
    }

    // 9ID
    function getAllRegisterApplyIds() external view returns (uint[] memory) {
        uint[] memory applyIds = new uint[](registerApplyCount);
        for (uint i = 0; i < registerApplyCount; i++) {
            applyIds[i] = i;
        }
        return applyIds;
    }

    // 10ID
    function getUserApplyId(address _user) external view returns (uint, bool) {
        uint applyId = addressToApplyId[_user];
        if (applyId == 0) {
            return (0, false);
        }
        return (applyId - 1, true);
    }

    // 11
    function getRegisterApplies(uint[] calldata _applyIds) external view returns (
        address[] memory applicants,
        uint[] memory applyTimes,
        ApplyStatus[] memory statuses,
        uint[] memory auditTimes
    ) {
        uint length = _applyIds.length;
        applicants = new address[](length);
        applyTimes = new uint[](length);
        statuses = new ApplyStatus[](length);
        auditTimes = new uint[](length);
        
        for (uint i = 0; i < length; i++) {
            if (_applyIds[i] >= registerApplyCount) {
                continue; // ID
            }
            RegisterApply storage registerApply = registerApplies[_applyIds[i]];
            applicants[i] = registerApply.applicantAddress;
            applyTimes[i] = registerApply.applyTime;
            statuses[i] = registerApply.status;
            auditTimes[i] = registerApply.auditTime;
        }
    }
}
